import React, { useState, useEffect, useContext } from 'react';
import {
  Box,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
  Grid,
  Card,
  CardContent,
  Alert,
} from '@mui/material';
import { UserContext } from '../contexts/UserContext';

const MetricsViewer = ({ plantId, plantName }) => {
  const [metrics, setMetrics] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const { token } = useContext(UserContext);

  useEffect(() => {
    const today = new Date();
    const weekAgo = new Date(today.getTime() - 7 * 24 * 60 * 60 * 1000);
    setStartDate(weekAgo.toISOString().split('T')[0]);
    setEndDate(today.toISOString().split('T')[0]);
  }, []);

  const fetchMetrics = async () => {
    if (!plantId || !token) return;

    try {
      const params = new URLSearchParams();
      if (startDate) params.append('startDate', startDate);
      if (endDate) params.append('endDate', endDate);

      const response = await fetch(`/api/plants/${plantId}/metrics?${params}`, {
        headers: { 'Authorization': `Bearer ${token}` },
      });

      if (response.ok) {
        const data = await response.json();
        setMetrics(data.sort((a, b) => new Date(b.date) - new Date(a.date)));
      } else {
        setError('Failed to fetch metrics');
      }
    } catch (err) {
      setError('Error connecting to server');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (plantId && token) {
      fetchMetrics();
    }
  }, [plantId, token, startDate, endDate]);

  const calculateAverages = () => {
    if (metrics.length === 0) return {};

    const validMetrics = metrics.filter(m => m.ec !== null || m.ph !== null || m.temperature !== null || m.humidity !== null);

    if (validMetrics.length === 0) return {};

    const sums = validMetrics.reduce((acc, metric) => {
      if (metric.ec !== null) acc.ec += metric.ec;
      if (metric.ph !== null) acc.ph += metric.ph;
      if (metric.temperature !== null) acc.temperature += metric.temperature;
      if (metric.humidity !== null) acc.humidity += metric.humidity;
      acc.count++;
      return acc;
    }, { ec: 0, ph: 0, temperature: 0, humidity: 0, count: 0 });

    return {
      ec: (sums.ec / validMetrics.filter(m => m.ec !== null).length).toFixed(2),
      ph: (sums.ph / validMetrics.filter(m => m.ph !== null).length).toFixed(2),
      temperature: (sums.temperature / validMetrics.filter(m => m.temperature !== null).length).toFixed(1),
      humidity: (sums.humidity / validMetrics.filter(m => m.humidity !== null).length).toFixed(1),
    };
  };

  const averages = calculateAverages();

  if (loading) return <Typography>Loading metrics...</Typography>;

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Metrics for {plantName}
      </Typography>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <Grid container spacing={2} sx={{ mb: 3 }}>
        <Grid item xs={6}>
          <TextField
            label="Start Date"
            type="date"
            fullWidth
            size="small"
            InputLabelProps={{ shrink: true }}
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
          />
        </Grid>
        <Grid item xs={6}>
          <TextField
            label="End Date"
            type="date"
            fullWidth
            size="small"
            InputLabelProps={{ shrink: true }}
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
          />
        </Grid>
      </Grid>

      {/* Averages Cards */}
      {Object.keys(averages).length > 0 && (
        <Grid container spacing={2} sx={{ mb: 3 }}>
          <Grid item xs={3}>
            <Card>
              <CardContent sx={{ textAlign: 'center', py: 1 }}>
                <Typography variant="h6" color="primary">
                  {averages.ec || 'N/A'}
                </Typography>
                <Typography variant="caption">Avg EC</Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardContent sx={{ textAlign: 'center', py: 1 }}>
                <Typography variant="h6" color="primary">
                  {averages.ph || 'N/A'}
                </Typography>
                <Typography variant="caption">Avg pH</Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardContent sx={{ textAlign: 'center', py: 1 }}>
                <Typography variant="h6" color="primary">
                  {averages.temperature || 'N/A'}°C
                </Typography>
                <Typography variant="caption">Avg Temp</Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={3}>
            <Card>
              <CardContent sx={{ textAlign: 'center', py: 1 }}>
                <Typography variant="h6" color="primary">
                  {averages.humidity || 'N/A'}%
                </Typography>
                <Typography variant="caption">Avg Humidity</Typography>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      )}

      {/* Metrics Table */}
      <TableContainer component={Paper} sx={{ maxHeight: 400 }}>
        <Table stickyHeader size="small">
          <TableHead>
            <TableRow>
              <TableCell>Date</TableCell>
              <TableCell align="right">EC</TableCell>
              <TableCell align="right">pH</TableCell>
              <TableCell align="right">Temp (°C)</TableCell>
              <TableCell align="right">Humidity (%)</TableCell>
              <TableCell>Notes</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {metrics.length === 0 ? (
              <TableRow>
                <TableCell colSpan={6} align="center">
                  <Typography color="textSecondary">
                    No metrics recorded for this period
                  </Typography>
                </TableCell>
              </TableRow>
            ) : (
              metrics.map((metric) => (
                <TableRow key={metric.id}>
                  <TableCell>
                    {new Date(metric.date).toLocaleDateString()}
                  </TableCell>
                  <TableCell align="right">
                    {metric.ec !== null ? metric.ec : '-'}
                  </TableCell>
                  <TableCell align="right">
                    {metric.ph !== null ? metric.ph : '-'}
                  </TableCell>
                  <TableCell align="right">
                    {metric.temperature !== null ? metric.temperature : '-'}
                  </TableCell>
                  <TableCell align="right">
                    {metric.humidity !== null ? metric.humidity : '-'}
                  </TableCell>
                  <TableCell>
                    {metric.notes || '-'}
                  </TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default MetricsViewer;
